// ==UserScript==
// @name         Yumbi management extra links
// @namespace    http://tampermonkey.net/
// @version      2024-07-22
// @description  try to take over the world!
// @author       You
// @include      /.*LaunchPad$/
// @icon         https://www.google.com/s2/favicons?sz=64&domain=yumbi.com
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    console.log("-- add buttons! --");

    const icons = {
        "Settings": "data:image/png;base64,",
        "Sagas": "data:image/png;base64,"
    };

    function addLinks() {
        var container = document.querySelector("div.access-links");
        if (!container) {
            return false;
        }
        addLink(container, "Settings", "Admin/ApplicationSettings");
        addLink(container, "Sagas", "Admin/Sagas");
        return true;
    }

    function addLink(container, title, path) {
        const anchor = document.createElement("a");
        anchor.href = path;
        var inner = document.createElement("div");
        inner.classList.add("quick-link-container");
        anchor.appendChild(inner);
        var sub = document.createElement("div");
        var header =document.createElement("h3");
        header.innerText = title;
        var icon = document.createElement("img");
        icon.src = icons[title];
        sub.appendChild(icon);
        sub.appendChild(header);
        inner.appendChild(sub);

        container.appendChild(anchor);
    }

    function tryAddLinks() {
        window.setTimeout(() => {
            var added = addLinks();
            if (!added) {
                tryAddLinks();
            }
        }, 100);
    }

    tryAddLinks();
})();